import React from "react";
import { Link } from "react-router-dom";

export default function Locations({ imagePath, text, label, location, path }) {
  return (
    <div>
      <Link to={path}>
        <figure data-category={label}>
          <img src={imagePath} alt="" />
        </figure>
        <div>{text}</div>
        <div>{location}</div>
      </Link>
    </div>
  );
}
